INSERT INTO {schema}.datasource_types VALUES (1, 'internal', 'Internal Table', 'Table inside the same database instance.');
INSERT INTO {schema}.datasource_types VALUES (2, 'external', 'External Table', 'SQL table in an external database instance, but of same structure.');
INSERT INTO {schema}.datasource_types VALUES (3, 'csv', 'Local CSV File', 'Standard csv file source on the database server machine.');
INSERT INTO {schema}.datasource_types VALUES (4, 'local', 'Local Blob', 'Any kind of local file without I/O capabilities. Generic fallback type.');
INSERT INTO {schema}.datasource_types VALUES (5, 'netCDF', 'Local netCDF File', 'netCDF file source on the local file system.');
INSERT INTO {schema}.datatypes VALUES (1, NULL, 'blob', 'File Blob', 'Any kind of file-like-structure. Reader will only return file paths. Not for use in production. Can be used as a placeholder for custom data management.');
INSERT INTO {schema}.datatypes VALUES (11, NULL, 'array', 'generic array structure', 'Arrays are a series of data objects, without index.');
INSERT INTO {schema}.datatypes VALUES (12, 11, 'iarray', 'indexed array', 'Array with additional index information for each element, that is not a datetime.');
INSERT INTO {schema}.datatypes VALUES (13, 12, 'varray', 'named, indexed array', 'An iarray that additionally has a name property of any valid metacatalog Variable.');
INSERT INTO {schema}.datatypes VALUES (14, 11, 'timeseries', 'timeseries', 'Array indexed by datetime information. The datetimes need to be of increasing order.');
INSERT INTO {schema}.datatypes VALUES (15, 14, 'vtimeseries', 'named timeseries', 'Timeseries that holds an additional Variable name to describe the content.');
INSERT INTO {schema}.datatypes VALUES (16, NULL, 'ndarray', 'generic mulidimensional array', 'NDArrays are multidimensional arrays of common atomic data-type.');
INSERT INTO {schema}.datatypes VALUES (17, 16, 'raster', 'Raster data', 'GDAL conform raster images.');
INSERT INTO {schema}.datatypes VALUES (18, 17, 'vraster', 'named raster data', 'The named raster images are not implemented yet.');
INSERT INTO {schema}.datatypes VALUES (19, 16, '2darray', '2D-array', 'Special case of NDArray with exactly two dimensions.');
INSERT INTO {schema}.datatypes VALUES (20, 16, 'idataframe', 'indexed table', 'NDArray with any index except datetime information.');
INSERT INTO {schema}.datatypes VALUES (21, 20, 'vdataframe', 'named, indexed table', 'idataframe with additional name property of any valid metacatalog Variable.');
INSERT INTO {schema}.datatypes VALUES (22, 16, 'time-dataframe', 'timeseries table', 'NDArray indexed by datetime information. The datetimes need to be of increasing order.');
INSERT INTO {schema}.datatypes VALUES (23, 22, 'vtime-dataframe', 'named timeseries table', 'Timeseries table that holds an additional Variable name to describe the content.');
