INSERT INTO {schema}.entrygroup_types VALUES (1, 'Project', 'A Project groups datasets into a lager collection of datasets that have been collected or used in the same Campaign.');
INSERT INTO {schema}.entrygroup_types VALUES (2, 'Composite', 'A composite dataset groups a number of datasets that are inseparable.');
INSERT INTO {schema}.entrygroup_types VALUES (3, 'Split dataset', 'A split dataset groups a number of identical datasets that have to be split e.g. in case of different time scale resolution.');
INSERT INTO {schema}.entrygroup_types VALUES (4, 'Label', 'A Label groups different datasets into a larger collection of datasets, that are now a composite, but i.e. collected at the same site.');
INSERT INTO {schema}.entrygroup_types VALUES (5, 'Dataset', 'A Dataset collects different self-contained entries (usually of different variables) that belong together. Other than composites, the single entries are self-contained and can be loaded individually.');
INSERT INTO {schema}.entrygroup_types VALUES (6, 'Site', 'A Site groups related entries, which have been collected at the same site. This can be used if the location or spatial-scale does not suffiently group the entries together.');
INSERT INTO {schema}.person_roles VALUES (1, 'author', 'the individual or organization whose name should appear first in the citation for the resource (for names that come after the first use co-author). while it is possible to have an author and principle investigator be the same individual or organization, author is not the same as nor synonymous with principle investigator. applicable mainly to documents, reports, memos, etc.');
INSERT INTO {schema}.person_roles VALUES (2, 'custodian', 'the individual or organization that has accountability and responsibility for the data and ensures appropriate care and maintenance of the resource.');
INSERT INTO {schema}.person_roles VALUES (3, 'distributor', 'the individual or organization that has accountability and responsibility for the data and ensures appropriate care and maintenance of the resource.');
INSERT INTO {schema}.person_roles VALUES (4, 'originator', 'the name of the individual or organization who is responsible for the data at the point when the data was first created. applicable for data sets that are an aggregation of two or more data sets or if the data set is the first instance of the signal having been converted into data.');
INSERT INTO {schema}.person_roles VALUES (5, 'owner', 'the individual or organization that has ownership of the resource.');
INSERT INTO {schema}.person_roles VALUES (6, 'pointOfContact', 'the individual or organization who is responsible for the initial triage of and answering questions related to the resource.');
INSERT INTO {schema}.person_roles VALUES (7, 'principalInvestigator', 'the individual or individuals who are the lead researchers for a grant (i.e. head of the laboratory, research group leader, etc.). if there are co-principal investigators then this field will repeat for each principle investigator. while it is possible to have a principal investigator and author be the same individual or organization, principal investigator is not the same nor synonymous with author.');
INSERT INTO {schema}.person_roles VALUES (8, 'processor', 'the name of the individual or organization who has processed the data in a manner such that the resource has been modified.');
INSERT INTO {schema}.person_roles VALUES (9, 'publisher', 'the individual or organization who prepares and issues the resource.');
INSERT INTO {schema}.person_roles VALUES (10, 'resourceProvider', 'the individual or organization that supplies or allocates the resource for another entity.');
INSERT INTO {schema}.person_roles VALUES (11, 'sponsor', 'the individual or organization who is providing sponsorship for the resource.');
INSERT INTO {schema}.person_roles VALUES (12, 'user', 'the individuals or organizations who are the intended consumers of the resource.');
INSERT INTO {schema}.person_roles VALUES (13, 'coAuthor', 'the individual(s) or organization(s) who name(s) should appear after the first name in a citation for the resource (use author to denote the first name in the citation). while it is possible to have a co-author and principal investigator/collaborator be the same individual or organization, co-author is no the same as nor synonymous with principle investigator or collaborator');
INSERT INTO {schema}.person_roles VALUES (14, 'collaborator', 'party who assists with the generation of the resource other than the principal investigator');
INSERT INTO {schema}.person_roles VALUES (15, 'contributor', 'the individuals or organizations whose contributions deserve recognition in the citation. contributor is mutually exclusive from author, co-author, principal investigator, and collaborator. use ISO MD_Identification credit field to identify individual or organizations that should be given acknowledgement only.');
INSERT INTO {schema}.person_roles VALUES (16, 'editor', 'the individual who has made a corrective or editorial change to the resource as part of a systematic revision process.');
INSERT INTO {schema}.person_roles VALUES (17, 'funder', 'the individual or organization which has provided all or part of the finances associated with the resource.');
INSERT INTO {schema}.person_roles VALUES (18, 'mediator', 'a class of entity that mediates access to the resource and for whom the resource is intended or useful');
